import React, { Component } from 'react';
import { Col, Container, Row, Table } from 'react-bootstrap';
import * as pagination from "./redux/ducks/pagination/actions";
import { connect } from "react-redux";

class Leaderboard extends Component {
    constructor(props) {
        super(props);
        this.state = {
            startData: 0, //Page value start data
            endData: 5, //Page value end data,
            tableHead: []
        }
    }
    componentDidMount() {
        /**Fetching Songs from API*/
        fetch('http://jsonplaceholder.typicode.com/photos?_start=0&_limit=5')
            .then(response => response.json())
            .then(songs => {
                this.setState({
                    tableHead: Object.keys(songs[0])
                }, () => {
                    this.props.updateDataValue(songs);
                })
            });
    }
    componentDidUpdate(prevProps, prevState) {

    }


    render() {
        console.log(this.state)
        return (
            <div className="App">
                <Container>
                    <Table striped bordered hover>
                        <thead>
                            <tr>
                                {
                                    this.state.tableHead.length != 0 ? this.state.tableHead.map() : ''
                                }
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>1</td>
                                <td>Mark</td>
                                <td>Otto</td>
                                <td>@mdo</td>
                            </tr>
                            <tr>
                                <td>2</td>
                                <td>Jacob</td>
                                <td>Thornton</td>
                                <td>@fat</td>
                            </tr>
                            <tr>
                                <td>3</td>
                                <td colSpan="2">Larry the Bird</td>
                                <td>@twitter</td>
                            </tr>
                        </tbody>
                    </Table>
                </Container>
            </div>
        );
    }
}

const mapStateToProps = state => ({
    ...state.page_number
});

const mapDispatchToProps = dispatch => ({
    updateDataValue: (songs) => dispatch(pagination.currentPageNumber(songs)),
});

export default connect(mapStateToProps, mapDispatchToProps)(Leaderboard);
